import React from "react";

const CaseStudies = () => {
  return (
    <div id="case-studies-wrapper">
      <p>Case Studies</p>

      <div className="case-study-quickshow">Fishhook</div>
      <div className="case-study-quickshow">RipCamp</div>
      <div className="case-study-quickshow">Canopy</div>
      <div className="case-study-quickshow">AmpCamp</div>
    </div>
  );
};

export default CaseStudies;
